import user from "../ui/Userimg.png";

const img = {
  position: absolute,
  left: "318px",
  top: "23px"

};

function Userimg() {
  return (
      <div className='Userimg'>
      <img src={user} style={img} alt="Userimg"/>
      </div>

  );
}

export default Userimg;
